import React, {useState} from 'react';
import {Button, Container} from "react-bootstrap";
import CreateBrand from "../components/modals/CreateBrand";
import CreateDevice from "../components/modals/CreateDevice";
import CreateType from "../components/modals/CreateType";
import CreateCategory from "../components/modals/CreateCategory";
import CreateProcedure from "../components/modals/CreateProcedure";
import CreateProcInfo from "../components/modals/CreateProcInfo";

const Admin = () => {
    const [brandVisible, setBrandVisible] = useState(false)
    const [typeVisible, setTypeVisible] = useState(false)
    const [deviceVisible, setDeviceVisible] = useState(false)
    const [categoryVisible, setCategoryVisible] = useState(false)
    const [procedureVisible, setProcedureVisible] = useState(false)

    return (
        <Container className="d-flex flex-column">
            <Button
                variant={"outline-dark"}
                className="mt-4 p-2"
                onClick={() => setCategoryVisible(true)}
            >
                Додати category
            </Button>
            <Button
                variant={"outline-dark"}
                className="mt-4 p-2"
                onClick={() => setBrandVisible(true)}
            >
                Додати тип або бренд
            </Button>
            <Button
                variant={"outline-dark"}
                className="mt-4 p-2"
                onClick={() => setProcedureVisible(true)}
            >
                Додати procedure
            </Button>
            <CreateBrand show={categoryVisible} onHide={() => setCategoryVisible(false)}/>
            <CreateDevice show={procedureVisible} onHide={() => setProcedureVisible(false)}/>
            <CreateType show={typeVisible} onHide={() => setTypeVisible(false)}/>
        </Container>
    );
};

export default Admin;
